import React from "react";
import ReactDOM from 'react-dom';
import SignForm from './components/signForm';

  let fields =[
    {
      type: "text",
      name: "username",
      placeholder: "Username",
      id: "username",

    },
    {
      type: "email",
      name: "email",
      placeholder: "Email",
      id: "email",
    },
    {
      type: "password",
      name: "password",
      placeholder: "Password",
      id: "password",
    },
    {
      type: "password",
      name: "confirmPassword",
      placeholder: "Confirm Password",
      id: "confirmPassword",
    },
  ];
 ReactDOM.render(<SignForm info ={fields}/>, document.getElementById("root"));
